__NUXT_JSONP__("/", {data:[{articles:[{slug:"2023-08-22-menghadapi-tes-cpns-terbaru-psikotes-yang-perlu-anda-siapkan",description:"Mengetahui jenis-jenis psikotes yang dibutuhkan untuk lolos tes CPNS terbaru dan bagaimana platform mipdevp.com dapat membantu Anda mempersiapkannya secara efektif.",title:"Menghadapi Tes CPNS Terbaru: Psikotes yang Perlu Anda Siapkan",date:"2023-08-22T14:34:41.506Z",tags:["cpns","psikotes","karir"]},{slug:"2023-08-07-menguak-fenomena-psikotes-online-mengapa-semakin-banyak-yang-memilihnya",description:"Menjelajahi tren psikotes online dan mengapa mereka semakin populer di tengah dunia yang terus terhubung secara digital. Temukan bagaimana platform mipdevp.com membuatnya lebih mudah diakses.",title:"Menguak Fenomena Psikotes Online: Mengapa Semakin Banyak yang Memilihnya",date:"2023-08-07T05:11:36.334Z",tags:["general","psikotes online","karier"]},{slug:"2023-02-21-mengubah-dan-memperbarui-git-commit-menguasai-git-part-6",description:"Git merupakan salah satu tools version control yang paling populer digunakan oleh developer di seluruh dunia. Dalam penggunaannya, developer seringkali melakukan commit terlebih dahulu untuk menyimpan perubahan code yang dilakukan. Namun, terkadang ada kesalahan atau kekurangan yang ditemukan setelah melakukan commit. Untungnya, Git menyediakan cara untuk mengubah dan memperbarui commit yang telah dilakukan. Yuk, kita simak cara-cara mengubah dan memperbarui git commit dengan mudah dan cepat.",title:"Mengubah dan memperbarui git commit (Menguasai Git part 6)",date:"2023-02-21T05:06:07.348Z",tags:["git","github","vcs"]}]}],fetch:{},mutations:[]});